import React from 'react';
import Typography from '@material-ui/core/Typography';

const Resume = ({  }) => {
  return (
    <div>
      <h1>Resume</h1>
      <h1>PDF Example</h1>
      <Typography>
      TECHNICAL SKILLS
      </Typography>
      <Typography>
      Languages & Frameworks: Javascript (ES6+), React, Redux, jQuery, HTML/CSS 
      </Typography>
      <Typography>
      Databases: MongoDB, MySQL, PostgreSQL
      </Typography>
      <Typography>
      Languages & Frameworks: Javascript (ES6+), React, Redux, jQuery, HTML/CSS
      Databases: MongoDB, MySQL, PostgreSQL
      Other Technologies: NodeJS, Express, Jest/Enzyme, Mocha/Chai, Git, Babel, Webpack, AWS (EC2, S3), Docker, Git, Github, Trello, Styled-Components, Loader.io, New Relic, NGINX
      </Typography>
      {/* <p>Open a PDF file <a href="/Resume.pdf">example</a>.</p> */}
      {/* <embed src="Resume.pdf" type="application/pdf" width="100%"/> */}
    </div>
  )
}

export default Resume;
